import React from "react";
import PropTypes from "prop-types";

import Navigation from "../components/navigation";

const App = ({ Component }) => {
  return (
    <div>
      <Navigation />
      <Component />
    </div>
  );
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
